@rusembitaly Le mine del tweet ricordano mine di fabbricazione italiana Valsella/Tecnovar. 
Con la legge 374/1997 l'Italia le ha messe al bando e ne ha vietato la fabbricazione e l'esportazione.
L'Italia ha aderito al Trattato di Ottawa nel 1999 sulla loro messa al bando.

